  name: ObjectResult<T>
  nameWithType: ObjectResult<T>
  fullName: System.Data.Objects.ObjectResult<T>
  type: Class
  summary: Represents the result of an <xref href="stem.Data.Objects.ObjectQuery%601"></xref> as an enumerable collection of objects.
  remarks: This class implements <xref:System.Collections.Generic.IEnumerable%601> and <xref:System.IDisposable>. Instances of this class are returned from the <xref:System.Data.Objects.ObjectQuery%601.Execute%2A> method and from the <xref:System.Data.Objects.ObjectQuery%601.System.Collections.Generic.IEnumerable%601.GetEnumerator%2A> method.
  example:
  - "The example in this topic is based on the [AdventureWorks Sales Model](http://msdn.microsoft.com/en-us/f16cd988-673f-4376-b034-129ca93c7832), which was generated by the [Entity Data Model Wizard](http://msdn.microsoft.com/en-us/423ec9a7-5464-43b7-a7ef-9f5f000848b5).  \n  \n The following example returns an ObjectResult(T) from the <xref:System.Data.Objects.ObjectQuery%601.Execute%2A> method. Then it gets an enumerator and iterates through the query results. At the end, it releases the enumerator and the ObjectResult(T) object.  \n  \n [!code-vb[DP ObjectServices Concepts#ObjectQuery_Execute](~/add/codesnippet/visualbasic/objectservicesconceptsvb/Source.vb#objectquery_execute)]\n [!code-cs[DP ObjectServices Concepts#ObjectQuery_Execute](~/add/codesnippet/csharp/objectservicesconceptscs/Source.cs#objectquery_execute)]"
