  summary: Returns an enumerator that iterates through the query results.
  remarks: The enumerator must be disposed when no longer needed. Using the `foreach` statement (`For Each` in Visual Basic) ensures that the enumerator is correctly disposed when iteration over the results is complete.
  example:
  - "The example in this topic is based on the [AdventureWorks Sales Model](http://msdn.microsoft.com/en-us/f16cd988-673f-4376-b034-129ca93c7832). The example returns an <xref:System.Data.Objects.ObjectResult%601> from the <xref:System.Data.Objects.ObjectQuery%601.Execute%2A> method. Then it gets an enumerator and iterates through the query results. At the end, it releases the enumerator and the <xref:System.Data.Objects.ObjectResult%601> object.  \n  \n [!code-vb[DP ObjectServices Concepts#QueryResult](~/add/codesnippet/visualbasic/objectservicesconceptsvb/Source.vb#queryresult)]\n [!code-cs[DP ObjectServices Concepts#QueryResult](~/add/codesnippet/csharp/objectservicesconceptscs/Source.cs#queryresult)]"
